import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses=[
    {
      id: 'e1',
      title: 'Toilet Paper',
      cost: 94.12,
      date: new Date(2020, 7, 14),
    },

    { id: 'e2',
      title: 'New TV',
      cost: 799.49, 
      date: new Date(2021, 2, 12) 
    },

    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },

    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ]
  return (
    <div>
      <h2>Expense tracker</h2>
      <ExpenseItem Title={expenses[0].Title} cost={expenses[0].cost} date={expenses[0].date}></ExpenseItem>
      <ExpenseItem Title={expenses[1].Title} cost={expenses[1].cost} date={expenses[1].date}></ExpenseItem>
      <ExpenseItem Title={expenses[2].Title} cost={expenses[2].cost} date={expenses[2].date}></ExpenseItem>
      <ExpenseItem Title={expenses[3].Title} cost={expenses[3].cost} date={expenses[3].date}></ExpenseItem>
    </div>
  );
}

export default App;
